import React from 'react'
import { Route, Routes } from 'react-router-dom'
import HomePage from './HomePage'

const RouterPage = () => {
  return (
    <Routes>
        <Route path='/' element={<HomePage/>}/>
    </Routes>
  )
}

export default RouterPage
